const assert = require('assert');

const countChars = s => {
    let chars = {};
    for (let i =0; i < s.length; i++) {
        if (chars[s[i]] === undefined) chars[s[i]] = 1;
        else ++chars[s[i]];
    }
    return chars;
};

const isMaximumOne = charCount => {
    let diffc = 0;
    let med = charCount[0];
    for (let i = 1; i < charCount.length; i++) {
        if (charCount[i] !== med) {
            if (charCount[i] > 1 && Math.abs(charCount[i] - med) > 1) return false;
            diffc++;
        }
        if (diffc > 1) return false;
    }
    return true;
};

function isValid(s) {
    let cChars = countChars(s);
    console.log(cChars);
    let counts = Object.values(cChars);
    return isMaximumOne(counts) ? "YES" : "NO";
}


